<template>
	<view class="u-wrap">
		<fly-custom bgColor="bg-gradual-blue" :isBack="true">
			<block slot="content"></block>
		</fly-custom>

		<u-notice-bar mode="horizontal" type="primary" :list="listBar"></u-notice-bar>

		<!-- 二级联动 -->
		<view class="u-menu-wrap">
			<scroll-view scroll-y scroll-with-animation class="u-tab-view menu-scroll-view" :scroll-top="scrollTop"
			 :scroll-into-view="itemId">
				<view v-for="(item,index) in tabbar" :key="index" class="u-tab-item" :class="[current == index ? 'u-tab-item-active' : '']"
				 @tap.stop="swichMenu(index)">
					<text class="u-line-1 text-sm">{{item.name}}</text>
				</view>
			</scroll-view>
			<scroll-view :scroll-top="scrollRightTop" scroll-y scroll-with-animation class="right-box" @scroll="rightScroll">
				<view class="page-view">
					<view class="class-item" :id="'item' + index" v-for="(item , index) in tabbar" :key="index">
						<view class="item-title">
							<text>{{item.name}}</text>
						</view>
						<view class="cu-list menu-avatar" v-for="(item1, index1) in item.voices" :key="index1" >
							<view class="cu-item" @click="shareFc(item1.image,item1.downloadUrl)" data-target="Modal" :data-detail="item1">
								<view class="cu-avatar lg">{{index1+1}}</view>
								<view class="content">
									<view class="text-grey">
										<text class="text-df text-black  text-cut">{{item1.voicesName}}</text>
									</view>
									<view class="text-gray text-sm flex">
										<text class="text-cut">{{item1.voicesDes}}</text>
									</view>
								</view>
								<view class="action">
									<view class="text-grey text-xs">{{item1.voicesUpdate}}</view>
								</view>
							</view>
						</view>
					</view>
				</view>
			</scroll-view>
		</view>
		<!-- 加载更多 -->
		<u-loadmore bg-color="rgb(240, 240, 240)" :status="loadStatus" @loadmore="addRandomData"></u-loadmore>

		<!-- 图片展示由自己实现 -->
		<view class="flex_row_c_c modalView" :class="qrShow?'show':''">
			<view class="flex_column">
				<view class="backgroundColor-white padding1vh border_radius_10px">
					<image :src="poster.finalPath || ''" mode="widthFix" class="posterImage"></image>
				</view>
				<view class="flex_row marginTop2vh">
					<button open-type="share" plain="true" style="background: #0081ff; color: #FFFFFF;" type="default"
							size="mini">点击分享
					</button>
				</view>
			</view>
		</view>

		<!-- 画布 -->
		<view class="hideCanvasView">
			<canvas class="hideCanvas" canvas-id="default_PosterCanvasId"
					:style="{width: (poster.width||10) + 'px', height: (poster.height||10) + 'px'}"></canvas>
		</view>

		<!-- 弹窗确认 -->
		<view class="cu-modal" :class="cpShow?'show':''" @tap="copy">
			<view class="cu-dialog">
				<view class="modal_bg"></view>
				<view class="modal_main">
					<view class="content text-black text-bold">点击复制下载链接</view>
					<view class='margin-top'>
						<text class="text-gray text-sm text-cut">{{downloadUrl}}</text>
					</view>
				</view>
			</view>
		</view>
	</view>
</template>
<script>
	import classifyData from '@/common/data/voicedata.js';
	import h5Copy from '@/common/jsSdk/junyi-h5-copy/junyi-h5-copy.js';
	import _app from '@/components/QS-SharePoster/app.js';
	import {
		getSharePoster
	} from '@/components/QS-SharePoster/QS-SharePoster.js';
	export default {
		data() {
			return {
				scrollTop: 0, //tab标题的滚动条位置
				oldScrollTop: 0,
				current: 0, // 预设当前项的值
				menuHeight: 0, // 左边菜单的高度
				menuItemHeight: 0, // 左边菜单item的高度
				itemId: '', // 栏目右边scroll-view用于滚动的id
				tabbar: classifyData,
				menuItemPos: [],
				arr: [],
				scrollRightTop: 0, // 右边栏目scroll-view的滚动条高度
				timer: null, // 定时器
				customBarHeight: this.CustomBar,
				modalName: null,
				downloadUrl: '下载链接',
				poster: {},
				qrShow: false,
				canvasId: 'default_PosterCanvasId',
				cpShow: false,
				is_share_show: false,
				listBar: [
					'不定时更新资源，扫码关注小程序',
					'没有想听的有声书，请联系作者'
				],
			}
		},
		onLoad() {

		},
		onReady() {
			this.getMenuItemTop()
		},
		onShow() {
			if (this.is_share_show == true) {
				this.is_share_show = false;
				this.cpShow = true
				this.cpShow = true;
			}
		},
		methods: {
			// 点击左边的栏目切换
			async swichMenu(index) {
				if(this.arr.length == 0) {
					await this.getMenuItemTop();
				}
				if (index == this.current) return;
				this.scrollRightTop = this.oldScrollTop;
				this.$nextTick(function(){
					this.scrollRightTop = this.arr[index];
					this.current = index;
					this.leftMenuStatus(index);
				})
			},
			// 获取一个目标元素的高度
			getElRect(elClass, dataVal) {
				new Promise((resolve, reject) => {
					const query = uni.createSelectorQuery().in(this);
					query.select('.' + elClass).fields({
						size: true
					}, res => {
						// 如果节点尚未生成，res值为null，循环调用执行
						if (!res) {
							setTimeout(() => {
								this.getElRect(elClass);
							}, 10);
							return;
						}
						this[dataVal] = res.height;
						resolve();
					}).exec();
				})
			},
			// 观测元素相交状态
			async observer() {
				this.tabbar.map((val, index) => {
					let observer = uni.createIntersectionObserver(this);
					// 检测右边scroll-view的id为itemxx的元素与right-box的相交状态
					// 如果跟.right-box底部相交，就动态设置左边栏目的活动状态
					observer.relativeTo('.right-box', {
						top: 0
					}).observe('#item' + index, res => {
						if (res.intersectionRatio > 0) {
							let id = res.id.substring(4);
							this.leftMenuStatus(id);
						}
					})
				})
			},
			// 设置左边菜单的滚动状态
			async leftMenuStatus(index) {
				this.current = index;
				// 如果为0，意味着尚未初始化
				if (this.menuHeight == 0 || this.menuItemHeight == 0) {
					await this.getElRect('menu-scroll-view', 'menuHeight');
					await this.getElRect('u-tab-item', 'menuItemHeight');
				}
				// 将菜单活动item垂直居中
				this.scrollTop = index * this.menuItemHeight + this.menuItemHeight / 2 - this.menuHeight / 2;
			},
			// 获取右边菜单每个item到顶部的距离
			getMenuItemTop() {
				new Promise(resolve => {
					let selectorQuery = uni.createSelectorQuery();
					selectorQuery.selectAll('.class-item').boundingClientRect((rects) => {
						// 如果节点尚未生成，rects值为[](因为用selectAll，所以返回的是数组)，循环调用执行
						if(!rects.length) {
							setTimeout(() => {
								this.getMenuItemTop();
							}, 10);
							return ;
						}
						rects.forEach((rect) => {
							// 这里减去rects[0].top，是因为第一项顶部可能不是贴到导航栏(比如有个搜索框的情况)
							this.arr.push(rect.top - rects[0].top);
							resolve();
						})
					}).exec()
				})
			},
			// 右边菜单滚动
			async rightScroll(e) {
				this.oldScrollTop = e.detail.scrollTop;
				if(this.arr.length == 0) {
					await this.getMenuItemTop();
				}
				if(this.timer) return ;
				if(!this.menuHeight) {
					await this.getElRect('menu-scroll-view', 'menuHeight');
				}
				setTimeout(() => { // 节流
					this.timer = null;
					// scrollHeight为右边菜单垂直中点位置
					let scrollHeight = e.detail.scrollTop + this.menuHeight / 2;
					for (let i = 0; i < this.arr.length; i++) {
						let height1 = this.arr[i];
						let height2 = this.arr[i + 1];
						// 如果不存在height2，意味着数据循环已经到了最后一个，设置左边菜单为最后一项即可
						if (!height2 || scrollHeight >= height1 && scrollHeight < height2) {
							this.leftMenuStatus(i);
							return ;
						}
					}
				}, 10)
			},
			// 构造分享图片
			async shareFc(imgUrl,download) {
				try {
					this.downloadUrl = download;
					if(!imgUrl){
						imgUrl = '../../static/img/wx.png';
					}
					_app.log('准备生成:' + new Date())
					const d = await getSharePoster({
						_this: this, //若在组件中使用 必传
						type: 'testShareType',
						formData: {
							//访问接口获取背景图携带自定义数据
						},
						backgroundImage: imgUrl,
						// backgroundImage: imgUrl,
						posterCanvasId: this.canvasId, //canvasId
						delayTimeScale: 20, //延时系数
						drawArray: ({
										bgObj,
										type,
										bgScale
									}) => {
							//可直接return数组，也可以return一个promise对象, 但最终resolve一个数组, 这样就可以方便实现后台可控绘制海报
							return new Promise((rs, rj) => {
								rs([{
									type: 'custom',
									setDraw(Context) {
										Context.setFillStyle('black');
										Context.setGlobalAlpha(0.3);
										Context.fillRect(0, bgObj.height - bgObj
												.width * 0.3, bgObj.width, bgObj
												.width * 0.3);
										Context.setGlobalAlpha(1);
									}
								},
									{
										type: 'image',
										url: '../../static/img/wx.png',
										dx: bgObj.width * 0.05,
										dy: bgObj.height - bgObj.width * 0.25,
										infoCallBack(imageInfo) {
											let scale = bgObj.width * 0.2 / imageInfo
													.height;
											return {
												circleSet: {
													x: imageInfo.width * scale / 2,
													y: bgObj.width * 0.2 / 2,
													r: bgObj.width * 0.2 / 2
												}, // 圆形图片 , 若circleSet与roundRectSet一同设置 优先circleSet设置
												dWidth: imageInfo.width *
														scale, // 因为设置了圆形图片 所以要乘以2
												dHeight: bgObj.width * 0.2,
											}
										}
									}
								]);
							})
						},
						setCanvasWH: ({
										  bgObj,
										  type,
										  bgScale
									  }) => { // 为动态设置画布宽高的方法，
							this.poster = bgObj;
						}
					});
					_app.log('海报生成成功, 时间:' + new Date() + '， 临时路径: ' + d.poster.tempFilePath)
					this.poster.finalPath = d.poster.tempFilePath;
					this.qrShow = true;

				} catch (e) {
					_app.hideLoading();
					_app.showToast(JSON.stringify(e));
					console.log(JSON.stringify(e));
				}
			},
			// 分享小程序
			async onShareAppMessage(res) {
				if (res.from === 'button') { // 来自页面内分享按钮
					console.log(res.target)
				}
				this.is_share_show = true;
				this.qrShow = false;
				return await this.commonShareMessage();
			},
			async onShareTimeline(res) {
				if (res.from === 'button') { // 来自页面内分享按钮
					console.log(res.target)
				}
				this.is_share_show = true;
				return await this.commonShareMessage();
			},
			commonShareMessage() {
				return {
					title: '白嫖资源就是香',
					path: '/pages/index/index',
					imageUrl: this.poster.finalPath,
				}
			},
			// 复制触发方法
			copy() {
				let content = this.downloadUrl // 复制内容，必须字符串，数字需要转换为字符串
				// #ifdef H5
				const result = h5Copy(content)
				if (result === false) {
					uni.showToast({
						title: '不支持',
						icon: 'none'
					})
				} else {
					uni.showToast({
						title: '复制成功',
						icon: 'none'
					})
				}
				// #endif

				// #ifdef MP-WEIXIN
				uni.setClipboardData({
					data: content,//要被复制的内容
					success: () => {//复制成功的回调函数
						uni.showToast({//提示
							title: '复制成功',
							icon: 'none'
						})
					}
				});
				// #endif
				this.cpShow = false;
				this.downloadUrl = null;

			}
		}
	}
</script>

